import React from 'react';

export default function Skills() {
    return (
        <section className='skills' id='skills'>
            <h2 className='heading'>My Skills</h2>
            <h3>Coding Skills</h3>
            <li>Javascript</li>
            <li>TypeScript</li>
            <li>HTML</li>
            <li>CSS</li>
        </section>
    )
}
